const HeaderHero = () => {
    return(
        <div className="">
            <p>COLLUSION</p>
            <p>An exclusive selection of this season's trends.</p>
            <div>
                <button>DISCOVER</button>
                <button>SHOP NOW</button>
            </div>
        </div>
    )
}

export default HeaderHero
